import {useState} from 'react';
import ChoiceList from './ChoiceList';
const Choice = () => {
    const [choices, setChoices]=[
        {title:"question 1111", choice1:"yes",choice2:"no", key:1},
        {title:"question 2222", choice1:"yes",choice2:"no", key:2},
        {title:"question 3333", choice1:"yes",choice2:"no", key:3}
    ]
    return ( 
        <div className="Choice">
            <ChoiceList choices={choices}></ChoiceList>
        </div>
     );
}

export default Choice;
